import AboutPage from './pages/About';

import {Spring} from 'react-spring/renderprops'


function App() {
  return (
    <Spring from={{ opacity: 0 }} to={{ opacity: 1 }}>

    {props => (
        <div style={{props}}>
            <h1>test</h1>
        </div>
    )}

</Spring>
